"original": |2-
     o  'document-format-error': The Job was aborted by the system because
        the Printer encountered an error in the Document data while
        processing it.  If the Printer posts this reason, the Document
        data has already passed any tests that would have led to the
        'unsupported-document-format' "job-state-reasons" value.
"fixed": |-
  -  'document-format-error': The Job was aborted by the system because the Printer encountered an error in the Document data while processing it.  If the Printer posts this reason, the Document data has already passed any tests that would have led to the 'unsupported-document-format' "job-state-reasons" value.
"ko": |-
  - 'document-format-error': 작업을 처리하는 동안 프린터에서 문서 데이터에 오류가 발생하여 작업이 시스템에 의해 중단되었습니다. 프린터가 이 이유를 게시하는 경우 문서 데이터는 '지원되지 않는 문서 형식' "작업 상태 이유" 값을 초래하는 모든 테스트를 이미 통과한 것입니다.
